import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import './global.css';
import App from './App';
require('react-toastify/dist/ReactToastify.css'); // Use require for non-ES modules

const { ToastContainer } = require('react-toastify');

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
      <ToastContainer
        position='bottom-center'
        autoClose={2000}
        hideProgressBar={true}
        closeButton={false}
        theme='colored'
      />
    </BrowserRouter>
  </React.StrictMode>
);
